import styled from 'styled-components';

export const FooterStyle = styled.footer`
      position: fixed;
            padding: 10px 10px 0px 10px;
            bottom: 0;
            width: 100%;
            /* Height of the footer*/ 
            height: 40px;
            background: grey;
`

export const ContactItem = styled.div`

    p {
        display: inline; 
    }
`

export const Icon = styled.div`

    display: inline;



`
